EffectAreas.reset(); // Remove player hands (no hands in game)

let mainDeck = CardStacks.active[0];
mainDeck.shuffle();

const horStacks = 7;
const startX = parseInt(GAME_INFO.defaultCardWidth / 2)
const startY = 0;

for (let x = 1; x <= horStacks; x++) {
    const left = startX + x * GAME_INFO.defaultCardWidth;
    const top = startY + GAME_INFO.defaultCardHeight;

    const n = x - 1;
    let offset = 0;
    if (n > 0) {
        const newStack = mainDeck.separate(n);
        offset = newStack.getPerceivedHeight() * newStack.cardVerticality;
        newStack.setPos({x: left, y: startY + offset});
        newStack.setFaceDown(true);
    }

    const faceUp = mainDeck.separate(1);
    faceUp.setPos({x: left, y: top + offset});
    faceUp.setFaceDown(false);
}
